/*
Stylus variables are information about icon's compiled state, stored under its original file name

.icon-home {
  width: $icon_home_width;
}

The large array-like variables contain all information about a single icon
$icon_home = x y offset_x offset_y width height total_width total_height image_path;

At the bottom of this section, we provide information about the spritesheet itself
$spritesheet = width height image $spritesheet_sprites;
*/
/*
These "retina group" variables are mappings for the naming and pairing of normal and retina sprites.

The list formatted variables are intended for mixins like `retinaSprite` and `retinaSprites`.
*/
/*
The provided mixins are intended to be used with the array-like variables

.icon-home {
  spriteWidth($icon_home)
}

.icon-email {
  sprite($icon_email)
}
*/
/*
The `retinaSprite` mixin sets up rules and a media query for a sprite/retina sprite.
  It should be used with a "retina group" variable.

The media query is from CSS Tricks: https://css-tricks.com/snippets/css/retina-display-media-query/

$icon_home_group = 'icon-home' $icon_home $icon_home_retina;

.icon-home {
  retinaSprite($icon_home_group)
}
*/
/*
The `sprites` mixin generates identical output to the CSS template
  but can be overridden inside of Stylus

This must be run when you have at least 2 sprites.
  If run with a single sprite, then there will be reference errors.

sprites($spritesheet_sprites);
*/
/*
The `retinaSprites` mixin generates a CSS rule and media query for retina group
  This yields the same output as CSS retina template but can be overridden in SCSS

retinaSprites($retina_groups);
*/
.sprite-dash-case {
  background-image: url("nested/dir/spritesheet.png");
  background-position: 0px 0px;
  width: 10px;
  height: 20px;
}
@media (min-resolution: 192dpi) {
  .sprite-dash-case {
    background-image: url("nested/dir/spritesheet-retina.png");
    background-size: 80px 100px;
  }
}
.sprite_snake_case {
  background-image: url("nested/dir/spritesheet.png");
  background-position: -10px -20px;
  width: 20px;
  height: 30px;
}
@media (min-resolution: 192dpi) {
  .sprite_snake_case {
    background-image: url("nested/dir/spritesheet-retina.png");
    background-size: 80px 100px;
  }
}
.spriteCamelCase {
  background-image: url("nested/dir/spritesheet.png");
  background-position: -30px -50px;
  width: 50px;
  height: 50px;
}
@media (min-resolution: 192dpi) {
  .spriteCamelCase {
    background-image: url("nested/dir/spritesheet-retina.png");
    background-size: 80px 100px;
  }
}

